INSERT INTO cool_cpu VALUES('deepcool gammaxx 300','{"author": "deepcool", "model": "gammaxx 300", "socket": "lga 115x/1200, lga 1700, am2, am2+, am3, am3+, am4, am5, fm1, fm2, fm2+", "fan_size": "120", "fan_speed": "900-1600", "tdp": "130"}','{"regard": {"price": 1380, "url": "https://www.regard.ru/product/120833/kuler-deepcool-gammaxx-300"}, "dns": {"price": 1450, "href": "https://www.dns-shop.ru/product/aa7eb3ad1c74ed20/kuler-dla-processora-deepcool-gammaxx-300-lga1700/"}}','https://www.regard.ru/api/site/cacheimg/goods/758468/1600','{"\u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c": "deepcool", "\u043a\u043e\u0434 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "dp-mch3-gmx300", "\u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435": "\u0434\u043b\u044f \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u043e\u0440\u0430", "socket": "lga 115x/1200, lga 1700, am2, am2+, am3, am3+, am4, am5, fm1, fm2, fm2+", "\u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u043e\u0445\u043b\u0430\u0436\u0434\u0435\u043d\u0438\u044f": "\u0430\u043a\u0442\u0438\u0432\u043d\u0430\u044f", "\u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0430\u044f \u0440\u0430\u0441\u0441\u0435\u0438\u0432\u0430\u0435\u043c\u0430\u044f \u043c\u043e\u0449\u043d\u043e\u0441\u0442\u044c": "130 \u0432\u0442", "\u0442\u0435\u043f\u043b\u043e\u0432\u044b\u0435 \u0442\u0440\u0443\u0431\u043a\u0438": "\u0434\u0430", "\u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "\u0430\u043b\u044e\u043c\u0438\u043d\u0438\u0439 + \u043c\u0435\u0434\u044c", "\u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432": "1", "\u0440\u0430\u0437\u043c\u0435\u0440\u044b \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "120x120 \u043c\u043c", "\u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c \u0432\u0440\u0430\u0449\u0435\u043d\u0438\u044f \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "900-1600 \u043e\u0431/\u043c\u0438\u043d", "\u0443\u0440\u043e\u0432\u0435\u043d\u044c \u0448\u0443\u043c\u0430 \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "17.8-21  \u0434\u0431", "\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0439 \u043f\u043e\u0442\u043e\u043a": "55.5 cfm", "\u0440\u0435\u0433\u0443\u043b\u044f\u0442\u043e\u0440 \u043e\u0431\u043e\u0440\u043e\u0442\u043e\u0432": "pwm", "\u043f\u043e\u0434\u0441\u0432\u0435\u0442\u043a\u0430": "\u043d\u0435\u0442", "\u0432\u044b\u0441\u043e\u0442\u0430 \u043a\u0443\u043b\u0435\u0440\u0430": "136 \u043c\u043c", "\u0446\u0432\u0435\u0442\u0430, \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u043d\u044b\u0435 \u0432 \u043e\u0444\u043e\u0440\u043c\u043b\u0435\u043d\u0438\u0438": "\u0441\u0438\u043d\u0438\u0439", "\u0440\u0430\u0437\u043c\u0435\u0440\u044b (\u0448\u0445\u0432\u0445\u0433)": "121 x 136 x 76 \u043c\u043c", "\u0432\u0435\u0441": "0.473 \u043a\u0433", "\u0433\u0430\u0440\u0430\u043d\u0442\u0438\u044f": "12 \u043c\u0435\u0441. ", "\u0441\u0430\u0439\u0442 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "www.deepcool.com"}');
