INSERT INTO cool_cpu VALUES('deepcool ak400 zero dark plus','{"author": "deepcool", "model": "deepcool ak400 zero dark plus", "socket": "am4, am5, lga 1150, lga 1151, lga 1155, lga 1156, lga 1200, lga 1700", "fan_size": "120", "fan_speed": "1650-500", "tdp": "220"}','{"regard": {"price": 4130, "url": "https://www.regard.ru/product/418845/kuler-deepcool-ak400-zero-dark-plus"}, "dns": {"price": 4299, "href": "https://www.dns-shop.ru/product/fe78a6c001abed20/kuler-dla-processora-deepcool-ak400-zero-dark-plus-r-ak400-bknnmd-g-1/"}}','https://www.regard.ru/api/site/cacheimg/goods/992257/1600','{"\u0433\u0430\u0440\u0430\u043d\u0442\u0438\u044f \u043f\u0440\u043e\u0434\u0430\u0432\u0446\u0430 / \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "36 \u043c\u0435\u0441.", "\u0441\u0442\u0440\u0430\u043d\u0430-\u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c": "\u043a\u0438\u0442\u0430\u0439", "\u0442\u0438\u043f": "\u043a\u0443\u043b\u0435\u0440 \u0434\u043b\u044f \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u043e\u0440\u0430", "\u043c\u043e\u0434\u0435\u043b\u044c": "deepcool ak400 zero dark plus", "\u043a\u043e\u0434 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "[r-ak400-bknnmd-g-1]", "\u0441\u043e\u043a\u0435\u0442": "am4, am5, lga 1150, lga 1151, lga 1155, lga 1156, lga 1200, lga 1700", "\u0440\u0430\u0441\u0441\u0435\u0438\u0432\u0430\u0435\u043c\u0430\u044f \u043c\u043e\u0449\u043d\u043e\u0441\u0442\u044c": "220 \u0432\u0442", "\u0442\u0438\u043f \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0438": "\u0431\u0430\u0448\u0435\u043d\u043d\u044b\u0439", "\u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u044f": "\u0430\u043b\u044e\u043c\u0438\u043d\u0438\u0439\\\u043c\u0435\u0434\u044c", "\u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "\u0430\u043b\u044e\u043c\u0438\u043d\u0438\u0439", "\u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0442\u0435\u043f\u043b\u043e\u0432\u044b\u0445 \u0442\u0440\u0443\u0431\u043e\u043a": "4", "\u0434\u0438\u0430\u043c\u0435\u0442\u0440 \u0442\u0435\u043f\u043b\u043e\u0432\u044b\u0445 \u0442\u0440\u0443\u0431\u043e\u043a": "6 \u043c\u043c", "\u043d\u0438\u043a\u0435\u043b\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u043e\u0435 \u043f\u043e\u043a\u0440\u044b\u0442\u0438\u0435": "\u043d\u0435\u0442", "\u0446\u0432\u0435\u0442 \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "\u0447\u0435\u0440\u043d\u044b\u0439", "\u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432 \u0432 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0442\u0435": "2", "\u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u043e\u0435 \u0447\u0438\u0441\u043b\u043e \u0443\u0441\u0442\u0430\u043d\u0430\u0432\u043b\u0438\u0432\u0430\u0435\u043c\u044b\u0445 \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432": "2", "\u0440\u0430\u0437\u043c\u0435\u0440\u044b \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0442\u043d\u044b\u0445 \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432": "120 x 120 \u043c\u043c", "\u0446\u0432\u0435\u0442 \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "\u0447\u0435\u0440\u043d\u044b\u0439", "\u0440\u0430\u0437\u044a\u0435\u043c \u0434\u043b\u044f \u043f\u043e\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u044f \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432": "4 pin", "\u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0430\u044f \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c \u0432\u0440\u0430\u0449\u0435\u043d\u0438\u044f": "1650 \u043e\u0431/\u043c\u0438\u043d", "\u043c\u0438\u043d\u0438\u043c\u0430\u043b\u044c\u043d\u0430\u044f \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c \u0432\u0440\u0430\u0449\u0435\u043d\u0438\u044f": "500 \u043e\u0431/\u043c\u0438\u043d", "\u0440\u0435\u0433\u0443\u043b\u0438\u0440\u043e\u0432\u043a\u0430 \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u0438 \u0432\u0440\u0430\u0449\u0435\u043d\u0438\u044f": "\u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f (pwm)", "\u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u044b\u0439 \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0439 \u043f\u043e\u0442\u043e\u043a": "59.46 cfm", "\u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u043e\u0435 \u0441\u0442\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0434\u0430\u0432\u043b\u0435\u043d\u0438\u0435": "15.9 \u043f\u0430", "\u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u044b\u0439 \u0443\u0440\u043e\u0432\u0435\u043d\u044c \u0448\u0443\u043c\u0430": "28 \u0434\u0431", "\u043d\u043e\u043c\u0438\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u0442\u043e\u043a": "0.1 \u0430", "\u043d\u043e\u043c\u0438\u043d\u0430\u043b\u044c\u043d\u043e\u0435 \u043d\u0430\u043f\u0440\u044f\u0436\u0435\u043d\u0438\u0435": "12 \u0432", "\u0442\u0438\u043f \u043f\u043e\u0434\u0448\u0438\u043f\u043d\u0438\u043a\u0430": "\u0441\u043a\u043e\u043b\u044c\u0436\u0435\u043d\u0438\u044f (\u0433\u0438\u0434\u0440\u043e\u0434\u0438\u043d\u0430\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0439)", "\u0442\u0435\u0440\u043c\u043e\u043f\u0430\u0441\u0442\u0430 \u0432 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0442\u0435": "\u043d\u0430\u043d\u0435\u0441\u0435\u043d\u0430 \u043d\u0430 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0435", "\u0442\u0438\u043f \u043f\u043e\u0434\u0441\u0432\u0435\u0442\u043a\u0438": "\u043d\u0435\u0442", "\u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0442\u0430\u0446\u0438\u044f": "\u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u0430\u0446\u0438\u044f, \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0442 \u043a\u0440\u0435\u043f\u043b\u0435\u043d\u0438\u044f", "\u0432\u044b\u