437\u043d\u0430\u0447\u0435\u043d\u0438\u0435": "\u0434\u043b\u044f \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u043e\u0440\u0430", "\u0441\u043e\u043a\u0435\u0442": "am4, am5, lga 1150, lga 1151, lga 1155, lga 1200, lga 1700", "\u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0432\u043e\u0434\u043e\u0431\u043b\u043e\u043a\u0430": "\u043c\u0435\u0434\u044c", "\u0440\u0430\u0437\u043c\u0435\u0440\u044b \u0432\u043e\u0434\u043e\u0431\u043b\u043e\u043a\u0430": "91 \u00d7 80 \u00d7 52 \u043c\u043c", "\u043c\u043e\u043d\u0442\u0430\u0436\u043d\u044b\u0439 \u0440\u0430\u0437\u043c\u0435\u0440 \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "120 \u043c\u043c - \u0434\u0432\u0435 \u0441\u0435\u043a\u0446\u0438\u0438", "\u0440\u0430\u0441\u0441\u0435\u0438\u0432\u0430\u0435\u043c\u0430\u044f \u043c\u043e\u0449\u043d\u043e\u0441\u0442\u044c, tdp": "220 \u0432\u0442", "\u0434\u043b\u0438\u043d\u0430 \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "282 \u043c\u043c", "\u0448\u0438\u0440\u0438\u043d\u0430 \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "120 \u043c\u043c", "\u0442\u043e\u043b\u0449\u0438\u043d\u0430 \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "27 \u043c\u043c", "\u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "\u0430\u043b\u044e\u043c\u0438\u043d\u0438\u0439", "\u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432 \u0432 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0442\u0435": "2", "\u0440\u0430\u0437\u043c\u0435\u0440\u044b \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432": "120 x 120 \u043c\u043c", "\u0442\u0438\u043f \u043f\u043e\u0434\u0448\u0438\u043f\u043d\u0438\u043a\u0430 \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "\u0441\u043a\u043e\u043b\u044c\u0436\u0435\u043d\u0438\u044f (\u0433\u0438\u0434\u0440\u043e\u0434\u0438\u043d\u0430\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0439)", "\u043c\u0438\u043d\u0438\u043c\u0430\u043b\u044c\u043d\u0430\u044f \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c \u0432\u0440\u0430\u0449\u0435\u043d\u0438\u044f": "500 \u043e\u0431/\u043c\u0438\u043d", "\u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0430\u044f \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c \u0432\u0440\u0430\u0449\u0435\u043d\u0438\u044f": "2250 \u043e\u0431/\u043c\u0438\u043d", "\u0440\u0435\u0433\u0443\u043b\u0438\u0440\u043e\u0432\u043a\u0430 \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u0438 \u0432\u0440\u0430\u0449\u0435\u043d\u0438\u044f \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "\u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f (pwm)", "\u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u044b\u0439 \u0443\u0440\u043e\u0432\u0435\u043d\u044c \u0448\u0443\u043c\u0430": "32.9 \u0434\u0431", "\u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u044b\u0439 \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0439 \u043f\u043e\u0442\u043e\u043a": "85.85 cfm", "\u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u043e\u0435 \u0441\u0442\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0434\u0430\u0432\u043b\u0435\u043d\u0438\u0435": "32 \u043f\u0430", "\u0440\u0430\u0437\u044a\u0435\u043c \u043f\u043e\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u044f \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432": "4 pin", "\u0443\u0440\u043e\u0432\u0435\u043d\u044c \u0448\u0443\u043c\u0430 \u043f\u043e\u043c\u043f\u044b": "17.8 \u0434\u0431", "\u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c \u0432\u0440\u0430\u0449\u0435\u043d\u0438\u044f \u043f\u043e\u043c\u043f\u044b": "2400 \u043e\u0431/\u043c\u0438\u043d", "\u0440\u0430\u0437\u044a\u0435\u043c \u043f\u043e\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u044f \u043f\u043e\u043c\u043f\u044b": "3 pin", "\u0434\u043b\u0438\u043d\u0430 \u0442\u0440\u0443\u0431\u043e\u043a": "415 \u043c\u043c", "\u043f\u0440\u043e\u0437\u0440\u0430\u0447\u043d\u044b\u0435 \u0442\u0440\u0443\u0431\u043a\u0438": "\u043d\u0435\u0442", "\u043e\u0441\u043e\u0431\u0435\u043d\u043d\u043e\u0441\u0442\u0438, \u0434\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u043e": "\u043d\u0430\u0431\u043e\u0440 \u043a\u0440\u0435\u043f\u0435\u0436\u043d\u044b\u0445 \u0432\u0438\u043d\u0442\u043e\u0432", "\u0442\u0435\u0440\u043c\u043e\u043f\u0430\u0441\u0442\u0430 \u0432 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0442\u0435": "\u0432 \u043e\u0442\u0434\u0435\u043b\u044c\u043d\u043e\u0439 \u0435\u043c\u043a\u043e\u0441\u0442\u0438"}');
INSERT INTO cool_lck VALUES('deepcool lt720','{"author": "deepcool", "model": "lt720", "type_cooling": "\u0441\u0432\u043e", "socket": "lga 115x/1200, lga 1700, lga 2011, 2011-3, lga 2066, am4, am5, tr4, strx4, sp3", "fan_size": "120x120", "fan_speed": "500-2250"}','{"regard": {"price": 12740, "url": "https://www.regard.ru/product/461977/sistema-zidkostnogo-oxlazdeniia-deepcool-lt720"}, "dns": {"price": 11999, "href": "https://www.dns-shop.ru/product/c7836d6c3b0bed20/sistema-ohlazdenia-deepcool-lt720/"}}','https://www.regard.ru/api/site/cacheimg/goods/1021860/1600','{"\u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c": "deepcool", "\u043a\u043e\u0434 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "r-lt720-bkamnf-g-1", "\u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u043e\u0445\u043b\u0430\u0436\u0434\u0435\u043d\u0438\u044f": "\u0436\u0438\u0434\u043a\u043e\u0441\u0442\u043d\u0430\u044f", "\u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435": "\u0434\u043b\u044f \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u043e\u0440\u0430", "socket": "lga 115x/1200, lga 1700, lga 2011, 2011-3, lga 2066, am4, am5, tr4, strx4, sp3", "\u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432": "3", "\u0440\u0430\u0437\u043c\u0435\u0440\u044b \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "120x120 \u043c\u043c", "\u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c \u0432\u0440\u0430\u0449\u0435\u043d\u0438\u044f \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "500-2250 \u043e\u0431/\u043c\u0438\u043d", "\u0443\u0440\u043e\u0432\u0435\u043d\u044c \u0448\u0443\u043c\u0430 \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "32.9 \u0434\u0431", "\u0442\u0438\u043f \u043f\u043e\u0434\u0448\u0438\u043f\u043d\u0438\u043a\u0430": "\u0433\u0438\u0434\u0440\u043e\u0434\u0438\u043d\u0430\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0439", "\u0440\u0435\u0433\u0443\u043b\u044f\u0442\u043e\u0440 \u043e\u0431\u043e\u0440\u043e\u0442\u043e\u0432": "pwm", "\u0440\u0430\u0437\u043c\u0435\u0440 \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "402\u0445120\u044527 \u043c\u043c", "\u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "\u0430\u043b\u044e\u043c\u0438\u043d\u0438\u0439", "\u043c\u043e\u043d\u0442\u0430\u0436\u043d\u044b\u0439 \u0440\u0430\u0437\u043c\u0435\u0440 \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "360 \u043c\u043c", "\u0440\u0430\u0437\u043c\u0435\u0440 \u043f\u043e\u043c\u043f\u044b": "94\u044580\u044568 \u043c\u043c", "\u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c \u043f\u043e\u043c\u043f\u044b": "3100 \u043e\u0431/\u043c\u0438\u043d", "\u0443\u0440\u043e\u0432\u0435\u043d\u044c \u0448\u0443\u043c\u0430 \u043f\u043e\u043c\u043f\u044b": "19 \u0434\u0431", "\u0442\u0438\u043f \u043a\u043e\u043d\u043d\u0435\u043a\u0442\u043e\u0440\u0430 \u043f\u043e\u043c\u043f\u044b": "3-pin", "\u043f\u043e\u0434\u0441\u0432\u0435\u0442\u043a\u0430": "\u0440\u0430\u0437\u043d\u043e\u0446\u0432\u0435\u0442\u043d\u0430\u044f", "\u0442\u0438\u043f \u043f\u043e\u0434\u0441\u0432\u0435\u0442\u043a\u0438": "argb (addressable rgb)", "\u0440\u0430\u0437\u044a\u0451\u043c \u043f\u043e\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u044f \u043f\u043e\u0434\u0441\u0432\u0435\u0442\u043a\u0438": "3-pin", "\u0446\u0432\u0435\u0442\u0430, \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u043d\u044b\u0435 \u0432 \u043e\u0444\u043e\u0440\u043c\u043b\u0435\u043d\u0438\u0438": "\u0441\u0435\u0440\u044b\u0439, \u0447\u0451\u0440\u043d\u044b\u0439", "\u0432\u0435\u0441": "1.856 \u043a\u0433", "\u0433\u0430\u0440\u0430\u043d\u0442\u0438\u044f": "12 \u043c\u0435\u0441. ", "\u0441\u0430\u0439\u0442 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "www.deepcool.com"}');
