 \u043f\u043e\u0442\u043e\u043a": "72.69 cfm", "\u0440\u0435\u0433\u0443\u043b\u044f\u0442\u043e\u0440 \u043e\u0431\u043e\u0440\u043e\u0442\u043e\u0432": "pwm", "\u0440\u0430\u0437\u043c\u0435\u0440 \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "395 \u0445 120 \u0445 27 \u043c\u043c", "\u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "\u0430\u043b\u044e\u043c\u0438\u043d\u0438\u0439", "\u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0432\u043e\u0434\u043e\u0431\u043b\u043e\u043a\u0430": "\u043c\u0435\u0434\u044c", "\u0436\u043a \u0434\u0438\u0441\u043f\u043b\u0435\u0439": "\u0434\u0430", "\u043f\u043e\u0434\u0441\u0432\u0435\u0442\u043a\u0430": "\u043d\u0435\u0442", "\u0433\u0430\u0440\u0430\u043d\u0442\u0438\u044f": "12 \u043c\u0435\u0441. ", "\u0441\u0430\u0439\u0442 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "www.thermaltake.com"}');
INSERT INTO cool_lck VALUES('id-cooling frostflow 240 xt','{"author": "id-cooling", "model": "id-cooling frostflow 240 xt [lga1700]", "type_cooling": "\u0441\u0432\u043e", "socket": "am4, lga 1150, lga 1151, lga 1151-v2, lga 1155, lga 1156, lga 1200, lga 1700, lga 2011, lga 2066", "fan_size": "120", "fan_speed": "1800-700"}','{"regard": {"price": 5000, "url": "https://www.regard.ru/product/440026/sistema-zidkostnogo-oxlazdeniia-id-cooling-frostflow-240-xt"}, "dns": {"price": 3699, "href": "https://www.dns-shop.ru/product/bfa08edd6481ed20/sistema-ohlazdenia-id-cooling-frostflow-240-xt-lga1700/"}}','https://www.regard.ru/api/site/cacheimg/goods/955480/1600','{"\u0433\u0430\u0440\u0430\u043d\u0442\u0438\u044f \u043f\u0440\u043e\u0434\u0430\u0432\u0446\u0430 / \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "24 \u043c\u0435\u0441.", "\u0441\u0442\u0440\u0430\u043d\u0430-\u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c": "\u043a\u0438\u0442\u0430\u0439", "\u0442\u0438\u043f": "\u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u043e\u0445\u043b\u0430\u0436\u0434\u0435\u043d\u0438\u044f", "\u043c\u043e\u0434\u0435\u043b\u044c": "id-cooling frostflow 240 xt [lga1700]", "\u043a\u043e\u0434 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "[frostflow 240 xt]", "\u043e\u0431\u0441\u043b\u0443\u0436\u0438\u0432\u0430\u0435\u043c\u0430\u044f \u0441\u0436\u043e": "\u043d\u0435\u0442", "\u043e\u0441\u043d\u043e\u0432\u043d\u043e\u0439 \u0446\u0432\u0435\u0442": "\u0447\u0435\u0440\u043d\u044b\u0439", "\u0442\u0438\u043f \u043f\u043e\u0434\u0441\u0432\u0435\u0442\u043a\u0438": "\u043e\u0434\u043d\u043e\u0446\u0432\u0435\u0442\u043d\u0430\u044f (\u0431\u0435\u043b\u0430\u044f)", "\u0438\u0441\u0442\u043e\u0447\u043d\u0438\u043a \u043f\u043e\u0434\u0441\u0432\u0435\u0442\u043a\u0438": "\u0432\u043e\u0434\u043e\u0431\u043b\u043e\u043a", "lcd \u0434\u0438\u0441\u043f\u043b\u0435\u0439": "\u043d\u0435\u0442", "\u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435": "\u0434\u043b\u044f \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u043e\u0440\u0430", "\u0441\u043e\u043a\u0435\u0442": "am4, lga 1150, lga 1151, lga 1151-v2, lga 1155, lga 1156, lga 1200, lga 1700, lga 2011, lga 2066", "\u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0432\u043e\u0434\u043e\u0431\u043b\u043e\u043a\u0430": "\u043c\u0435\u0434\u044c", "\u0440\u0430\u0437\u043c\u0435\u0440\u044b \u0432\u043e\u0434\u043e\u0431\u043b\u043e\u043a\u0430": "72 x 72 x 58 \u043c\u043c", "\u043c\u043e\u043d\u0442\u0430\u0436\u043d\u044b\u0439 \u0440\u0430\u0437\u043c\u0435\u0440 \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "120 \u043c\u043c - \u0434\u0432\u0435 \u0441\u0435\u043a\u0446\u0438\u0438", "\u0440\u0430\u0441\u0441\u0435\u0438\u0432\u0430\u0435\u043c\u0430\u044f \u043c\u043e\u0449\u043d\u043e\u0441\u0442\u044c, tdp": "250 \u0432\u0442", "\u0434\u043b\u0438\u043d\u0430 \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "276 \u043c\u043c", "\u0448\u0438\u0440\u0438\u043d\u0430 \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "120 \u043c\u043c", "\u0442\u043e\u043b\u0449\u0438\u043d\u0430 \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "27 \u043c\u043c", "\u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "\u0430\u043b\u044e\u043c\u0438\u043d\u0438\u0439", "\u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432 \u0432 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0442\u0435": "2", "\u0440\u0430\u0437\u043c\u0435\u0440\u044b \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432": "120 x 120 \u043c\u043c", "\u0442\u0438\u043f \u043f\u043e\u0434\u0448\u0438\u043f\u043d\u0438\u043a\u0430 \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "\u0441\u043a\u043e\u043b\u044c\u0436\u0435\u043d\u0438\u044f (