INSERT INTO cool_lck VALUES('msi mag coreliquid c280','{"author": "msi", "model": "mag coreliquid c280", "type_cooling": "\u0441\u0432\u043e", "socket": "lga 115x/1200, lga 1356, 1366, lga 1700, lga 2011, 2011-3, lga 2066, am2, am2+, am3, am3+, am4, am5, fm1, fm2, fm2+", "fan_size": "140x140", "fan_speed": "500-1800"}','{"regard": {"price": 14950, "url": "https://www.regard.ru/product/7814/sistema-zidkostnogo-oxlazdeniia-msi-mag-coreliquid-c280"}}','https://www.regard.ru/api/site/cacheimg/goods/893163/1600','{"\u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c": "msi", "\u043a\u043e\u0434 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "mag coreliquid c280", "\u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u043e\u0445\u043b\u0430\u0436\u0434\u0435\u043d\u0438\u044f": "\u0436\u0438\u0434\u043a\u043e\u0441\u0442\u043d\u0430\u044f", "\u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435": "\u0434\u043b\u044f \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u043e\u0440\u0430", "socket": "lga 115x/1200, lga 1356, 1366, lga 1700, lga 2011, 2011-3, lga 2066, am2, am2+, am3, am3+, am4, am5, fm1, fm2, fm2+", "\u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0430\u044f \u0440\u0430\u0441\u0441\u0435\u0438\u0432\u0430\u0435\u043c\u0430\u044f \u043c\u043e\u0449\u043d\u043e\u0441\u0442\u044c": "300 \u0432\u0442", "\u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432": "2", "\u0440\u0430\u0437\u043c\u0435\u0440\u044b \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "140x140 \u043c\u043c", "\u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c \u0432\u0440\u0430\u0449\u0435\u043d\u0438\u044f \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "500-1800 \u043e\u0431/\u043c\u0438\u043d", "\u0443\u0440\u043e\u0432\u0435\u043d\u044c \u0448\u0443\u043c\u0430 \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "14.8-33.28 \u0434\u0431", "\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0439 \u043f\u043e\u0442\u043e\u043a": "84.36 cfm", "\u0440\u0435\u0433\u0443\u043b\u044f\u0442\u043e\u0440 \u043e\u0431\u043e\u0440\u043e\u0442\u043e\u0432": "pwm", "\u0440\u0430\u0437\u043c\u0435\u0440 \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "316 x 140 x 27\u043c\u043c", "\u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "\u0430\u043b\u044e\u043c\u0438\u043d\u0438\u0439", "\u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0432\u043e\u0434\u043e\u0431\u043b\u043e\u043a\u0430": "\u043c\u0435\u0434\u044c", "\u043f\u043e\u0434\u0441\u0432\u0435\u0442\u043a\u0430": "\u0440\u0430\u0437\u043d\u043e\u0446\u0432\u0435\u0442\u043d\u0430\u044f", "\u0433\u0430\u0440\u0430\u043d\u0442\u0438\u044f": "12 \u043c\u0435\u0441. ", "\u0441\u0430\u0439\u0442 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "www.msi.com"}');
INSERT INTO cool_lck VALUES('thermalright frozen fusion 360 black argb','{"author": "thermalright", "model": "frozen fusion 360 black argb", "type_cooling": "\u0441\u0432\u043e", "socket": "lga 115x/1200, lga 1700, am4, am5", "fan_size": "120x120", "fan_speed": "2150"}','{"regard": {"price": 20810, "url": "https://www.regard.ru/product/9388/sistema-zidkostnogo-oxlazdeniia-thermalright-frozen-fusion-360-black-argb"}}','https://www.regard.ru/api/site/cacheimg/goods/5929716/1600','{"\u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c": "thermalright", "\u043a\u043e\u0434 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "f-fusion-360-bl-argb", "\u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u043e\u0445\u043b\u0430\u0436\u0434\u0435\u043d\u0438\u044f": "\u0436\u0438\u0434\u043a\u043e\u0441\u0442\u043d\u0430\u044f", "\u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435": "\u0434\u043b\u044f \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u043e\u0440\u0430", "socket": "lga 115x/1200, lga 1700, am4, am5", "\u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432": "3", "\u0440\u0430\u0437\u043c\u0435\u0440\u044b \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "120x120 \u043c\u043c", "\u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c \u0432\u0440\u0430\u0449\u0435\u043d\u0438\u044f \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "2150 \u043e\u0431/\u043c\u0438\u043d", "\u0443\u0440\u043e\u0432\u0435\u043d\u044c \u0448\u0443\u043c\u0430 \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "28.1 \u0434\u0431", "\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0439 \u043f\u043e\u0442\u043e\u043a": "69 cfm", "\u0442\u0438\u043f \u043f\u043e\u0434\u0448\u0438\u043f\u043d\u0438\u043a\u0430": "\u0433\u0438\u0434\u0440\u043e\u0434\u0438\u043d\u0430\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0439", "\u0440\u0435\u0433\u0443\u043b\u044f\u0442\u043e\u0440 \u043e\u0431\u043e\u0440\u043e\u0442\u043e\u0432": "pwm", "\u0440\u0430\u0437\u043c\u0435\u0440 \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "394\u0445120\u044527 \u043c\u043c", "\u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "\u0430\u043b\u044e\u043c\u0438\u043d\u0438\u0439", "\u043c\u043e\u043d\u0442\u0430\u0436\u043d\u044b\u0439 \u0440\u0430\u0437\u043c\u0435\u0440 \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430": "360 \u043c\u043c", "\u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c \u043f\u043e\u043c\u043f\u044b": "2800 \u043e\u0431/\u043c\u0438\u043d", "\u0443\u0440\u043e\u0432\u0435\u043d\u044c \u0448\u0443\u043c\u0430 \u043f\u043e\u043c\u043f\u044b": "28 \u0434\u0431", "\u0442\u0438\u043f \u043a\u043e\u043d\u043d\u0435\u043a\u0442\u043e\u0440\u0430 \u043f\u043e\u043c\u043f\u044b": "4-pin pwm", "\u043f\u043e\u0434\u0441\u0432\u0435\u0442\u043a\u0430": "\u0440\u0430\u0437\u043d\u043e\u0446\u0432\u0435\u0442\u043d\u0430\u044f", "\u0442\u0438\u043f \u043f\u043e\u0434\u0441\u0432\u0435\u0442\u043a\u0438": "argb (addressable rgb)", "\u0440\u0430\u0437\u044a\u0451\u043c \u043f\u043e\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u044f \u043f\u043e\u0434\u0441\u0432\u0435\u0442\u043a\u0438": "3-pin", "\u0446\u0432\u0435\u0442\u0430, \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u043d\u044b\u0435 \u0432 \u043e\u0444\u043e\u0440\u043c\u043b\u0435\u043d\u0438\u0438": "\u0447\u0451\u0440\u043d\u044b\u0439", "\u0433\u0430\u0440\u0430\u043d\u0442\u0438\u044f": "12 \u043c\u0435\u0441. ", "\u0441\u0430\u0439\u0442 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "www.thermalright.com"}');
INSERT INTO cool_lck VALUES('arctic cooling liquid freezer ii 420 a-rgb','{"author": "arctic", "model": "cooling liquid freezer ii 420 a-rgb", "type_cooling": "\u0441\u0432\u043e", "socket": "lga 115x/1200, lga 1700, lga 2011, 2011-3, lga 2066, am3, am3+, am4, am5", "fan_size": "140x140", "fan_speed": "200-1800"}','{"regard": {"price": 20530, "url": "https://www.regard.ru/product/419191/sistema-zidkostnogo-oxlazdeniia-arctic-cooling-liquid-freezer-ii-420-a-rgb"}}','https://www.regard.ru/api/site/cacheimg/goods/1047953/1600','{"\u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c": "arctic cooling", "\u043a\u043e\u0434 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "acfre00109a", "\u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u043e\u0445\u043b\u0430\u0436\u0434\u0435\u043d\u0438\u044f": "\u0436\u0438\u0434\u043a\u043e\u0441\u0442\u043d\u0430\u044f", "\u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435": "\u0434\u043b\u044f \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u043e\u0440\u0430", "socket": "lga 115x/1200, lga 1700, lga 2011, 2011-3, lga 2066, am3, am3+, am4, am5", "\u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432": "3", "\u0440\u0430\u0437\u043c\u0435\u0440\u044b \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "140x140 \u043c\u043c", "\u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c \u0432\u0440\u0430\u0449\u0435\u043d\u0438\u044f \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "200-1800 \u043e\u0431/\u043c\u0438\u043d", "\u0443\u0440\u043e\u0432\u0435\u043d\u044c \u0448\u0443\u043c\u0430 \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "22.5 \u0434\u0431", "\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0439 \u043f\u043e\u0442\u043e\u043a": "68.9 cfm", "\u0442\u0438\u043f \u043f\u043e\u0434\u0448\u0438\u043f\u043d\u0438\u043a\u0430": "\u0433\u0438\