INSERT INTO cool_case VALUES('id-cooling no-14025k','{"author": "id-cooling", "model": "no series [no-14025k]", "fan_size": "140", "fan_speed": "1600-800"}','{"regard": {"price": 780, "url": "https://www.regard.ru/product/328383/ventiliator-dlia-korpusa-id-cooling-no-14025k"}, "dns": {"price": 699, "href": "https://www.dns-shop.ru/product/b90119dd496e3332/ventilator-id-cooling-no-series-no-14025k/"}}','https://www.regard.ru/api/site/cacheimg/goods/768207/1600','{"\u0433\u0430\u0440\u0430\u043d\u0442\u0438\u044f \u043f\u0440\u043e\u0434\u0430\u0432\u0446\u0430 / \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "12 \u043c\u0435\u0441.", "\u0441\u0442\u0440\u0430\u043d\u0430-\u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c": "\u043a\u0438\u0442\u0430\u0439", "\u0442\u0438\u043f": "\u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440", "\u043c\u043e\u0434\u0435\u043b\u044c": "id-cooling no series", "\u043a\u043e\u0434 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "[no-14025k]", "\u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432 \u0432 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0442\u0435": "1", "\u0446\u0432\u0435\u0442 \u043a\u0430\u0440\u043a\u0430\u0441\u0430": "\u0447\u0435\u0440\u043d\u044b\u0439", "\u0446\u0432\u0435\u0442 \u043a\u0440\u044b\u043b\u044c\u0447\u0430\u0442\u043a\u0438": "\u0447\u0435\u0440\u043d\u044b\u0439", "\u0442\u0438\u043f \u043f\u043e\u0434\u0441\u0432\u0435\u0442\u043a\u0438": "\u043d\u0435\u0442", "\u0440\u0430\u0437\u043c\u0435\u0440 \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "140 x 140 \u043c\u043c", "\u0442\u043e\u043b\u0449\u0438\u043d\u0430 \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "25 \u043c\u043c", "\u0442\u0438\u043f \u043f\u043e\u0434\u0448\u0438\u043f\u043d\u0438\u043a\u0430": "\u0441\u043a\u043e\u043b\u044c\u0436\u0435\u043d\u0438\u044f (\u0433\u0438\u0434\u0440\u043e\u0434\u0438\u043d\u0430\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0439)", "\u0430\u043d\u0442\u0438\u0432\u0438\u0431\u0440\u0430\u0446\u0438\u043e\u043d\u043d\u0430\u044f \u043f\u0440\u043e\u043a\u043b\u0430\u0434\u043a\u0430": "\u0435\u0441\u0442\u044c", "\u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0430\u044f \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c \u0432\u0440\u0430\u0449\u0435\u043d\u0438\u044f": "1600 \u043e\u0431/\u043c\u0438\u043d", "\u043c\u0438\u043d\u0438\u043c\u0430\u043b\u044c\u043d\u0430\u044f \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c \u0432\u0440\u0430\u0449\u0435\u043d\u0438\u044f": "800 \u043e\u0431/\u043c\u0438\u043d", "\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0439 \u043f\u043e\u0442\u043e\u043a \u043d\u0430 \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u043e\u0439 \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u0438": "76.8 cfm", "\u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u043e\u0435 \u0441\u0442\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0434\u0430\u0432\u043b\u0435\u043d\u0438\u0435": "25.2 \u043f\u0430", "\u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u044b\u0439 \u0443\u0440\u043e\u0432\u0435\u043d\u044c \u0448\u0443\u043c\u0430": "32.6 \u0434\u0431", "\u043c\u0438\u043d\u0438\u043c\u0430\u043b\u044c\u043d\u044b\u0439 \u0443\u0440\u043e\u0432\u0435\u043d\u044c \u0448\u0443\u043c\u0430": "16.8 \u0434\u0431", "\u0442\u0438\u043f \u0440\u0430\u0437\u044a\u0435\u043c\u0430 \u043f\u0438\u0442\u0430\u043d\u0438\u044f \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "4 pin", "\u0440\u0435\u0433\u0443\u043b\u0438\u0440\u043e\u0432\u043a\u0430 \u043e\u0431\u043e\u0440\u043e\u0442\u043e\u0432": "\u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f (pwm)", "\u043d\u043e\u043c\u0438\u043d\u0430\u043b\u044c\u043d\u043e\u0435 \u04