41\u0442\u0430\u043b\u044c, \u0441\u0442\u0435\u043a\u043b\u043e", "\u043d\u0430\u043b\u0438\u0447\u0438\u0435 \u043e\u043a\u043d\u0430 \u043d\u0430 \u0431\u043e\u043a\u043e\u0432\u043e\u0439 \u0441\u0442\u0435\u043d\u043a\u0435": "\u0441\u043b\u0435\u0432\u0430", "\u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u043e\u043a\u043d\u0430": "\u0437\u0430\u043a\u0430\u043b\u0435\u043d\u043d\u043e\u0435 \u0441\u0442\u0435\u043a\u043b\u043e", "\u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b \u0444\u0440\u043e\u043d\u0442\u0430\u043b\u044c\u043d\u043e\u0439 \u043f\u0430\u043d\u0435\u043b\u0438": "\u043c\u0435\u0442\u0430\u043b\u043b\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0441\u0435\u0442\u043a\u0430, \u043f\u043b\u0430\u0441\u0442\u0438\u043a", "\u0442\u0438\u043f \u043f\u043e\u0434\u0441\u0432\u0435\u0442\u043a\u0438": "argb", "\u0446\u0432\u0435\u0442 \u043f\u043e\u0434\u0441\u0432\u0435\u0442\u043a\u0438": "\u043c\u043d\u043e\u0433\u043e\u0446\u0432\u0435\u0442\u043d\u0430\u044f", "\u0438\u0441\u0442\u043e\u0447\u043d\u0438\u043a \u043f\u043e\u0434\u0441\u0432\u0435\u0442\u043a\u0438": "\u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440", "\u0440\u0430\u0437\u044a\u0435\u043c \u043f\u043e\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u044f \u043f\u043e\u0434\u0441\u0432\u0435\u0442\u043a\u0438": "3-pin 5v-d-g (argb), sata power (15 pin)", "\u0441\u043f\u043e\u0441\u043e\u0431 \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u043f\u043e\u0434\u0441\u0432\u0435\u0442\u043a\u043e\u0439": "asrock polychrome, asus aura, gigabyte rgb fusion, msi mystic light, \u043a\u043d\u043e\u043f\u043a\u0430 \u043d\u0430 \u043a\u043e\u0440\u043f\u0443\u0441\u0435", "\u0444\u043e\u0440\u043c-\u0444\u0430\u043a\u0442\u043e\u0440 \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u0438\u043c\u044b\u0445 \u043f\u043b\u0430\u0442": "e-atx, micro-atx, mini-itx, standard-atx", "\u0444\u043e\u0440\u043c-\u0444\u0430\u043a\u0442\u043e\u0440 \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u0438\u043c\u044b\u0445 \u0431\u043b\u043e\u043a\u043e\u0432 \u043f\u0438\u0442\u0430\u043d\u0438\u044f": "atx", "\u0440\u0430\u0437\u043c\u0435\u0449\u0435\u043d\u0438\u0435 \u0431\u043b\u043e\u043a\u0430 \u043f\u0438\u0442\u0430\u043d\u0438\u044f": "\u043d\u0438\u0436\u043d\u0435\u0435", "\u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0430\u044f \u0434\u043b\u0438\u043d\u0430 \u0431\u043b\u043e\u043a\u0430 \u043f\u0438\u0442\u0430\u043d\u0438\u044f": "170 \u043c\u043c", "\u0433\u043e\u0440\u0438\u0437\u043e\u043d\u0442\u0430\u043b\u044c\u043d\u044b\u0435 \u0441\u043b\u043e\u0442\u044b \u0440\u0430\u0441\u0448\u0438\u0440\u0435\u043d\u0438\u044f": "7", "\u0432\u0435\u0440\u0442\u0438\u043a\u0430\u043b\u044c\u043d\u044b\u0435 \u0441\u043b\u043e\u0442\u044b \u0440\u0430\u0441\u0448\u0438\u0440\u0435\u043d\u0438\u044f": "\u043d\u0435\u0442", "\u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0430\u044f \u0434\u043b\u0438\u043d\u0430 \u0443\u0441\u0442\u0430\u043d\u0430\u0432\u043b\u0438\u0432\u0430\u0435\u043c\u043e\u0439 \u0432\u0438\u0434\u0435\u043e\u043a\u0430\u0440\u0442\u044b": "380 \u043c\u043c", "\u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u0430\u044f \u0432\u044b\u0441\u043e\u0442\u0430 \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u043e\u0440\u043d\u043e\u0433\u043e \u043a\u0443\u043b\u0435\u0440\u0430": "160 \u043c\u043c", "\u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u043e\u0442\u0441\u0435\u043a\u043e\u0432 2.5\" \u043d\u0430\u043a\u043e\u043f\u0438\u0442\u0435\u043b\u0435\u0439": "4 \u0448\u0442", "\u0447\u0438\u0441\u043b\u043e \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0438\u0445 \u043e\u0442\u0441\u0435\u043a\u043e\u0432 3.5\"": "2 \u0448\u0442", "\u0447\u0438\u0441\u043b\u043e \u0432\u043d\u0435\u0448\u043d\u0438\u0445 \u043e\u0442\u0441\u0435\u043a\u043e\u0432 3.5\"": "\u043d\u0435\u0442", "\u0447\u0438\u0441\u043b\u043e \u043e\u0442\u0441\u0435\u043a\u043e\u0432 5.25\"": "\u043d\u0435\u0442", "\u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u044b \u0432 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0442\u0435": "4 x 120 \u043c\u043c", "\u043f\u043e\u0434\u0434\u0435\u0440\u0436\u043a\u0430 \u0444\u0440\u043e\u043d\u0442\u0430\u043b\u044c\u043d\u044b\u0445 \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432": "2 x 140 \u0438\u043b\u0438 3 x 120 \u043c\u043c", "\u043f\u043e\u0434\u0434\u0435\u0440\u0436\u043a\u0430 \u0442\u044b\u043b\u043e\u0432\u044b\u0445 \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432": "1 x 120 \u043c\u043c", "\u043f\u043e\u0434\u0434\u0435\u0440\u0436\u043a\u0430 \u0432\u0435\u0440\u0445\u043d\u0438\u0445 \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432": "2 x 140 \u0438\u043b\u0438 2 x 120 \u043c\u043c", "\u043f\u043e\u0434\u0434\u0435\u0440\u0436\u043a\u0430 \u043d\u0438\u0436\u043d\u0438\u0445 \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432": "\u043d\u0435\u0442", "\u043f\u043e\u0434\u0434\u0435\u0440\u0436\u043a\u0430 \u0431\u043e\u043a\u043e\u0432\u044b\u0445 \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u043e\u0432": "\u043d\u0435\u0442", "\u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u044c \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043a\u0438 \u0441\u0438\u0441\u0442\u0435\u043c\u044b \u0436\u0438\u0434\u043a\u043e\u0441\u0442\u043d\u043e\u0433\u043e \u043e\u0445\u043b\u0430\u0436\u0434\u0435\u043d\u0438\u044f": "\u0435\u0441\u0442\u044c", "\u0444\u0440\u043e\u043d\u0442\u0430\u043b\u044c\u043d\u044b\u0439 \u043c\u043e\u043d\u0442\u0430\u0436\u043d\u044b\u0439 \u0440\u0430\u0437\u043c\u0435\u0440 \u0440\u0430\u0434\u0438\u0430\u0442\u043e\u0440\u0430 \u0441\u0436\u043e": "120 \u043c\u043c, 140 \u043c\u043c, 240 \u043c\u043c, 280 \u043c\u043c, 360 \u043c\u043c", "\u0432\u0435\u0440\u0445\u043d\u0438\u0439 \u043c\u043e\u043d\u0442\u0430\u0436\u043d\u044b\u0439 \u0440\u0430\u0