INSERT INTO spu VALUES('be quiet system power 10','{"author": "be quiet", "power": "450w", "form_factor": "atx12v 2.52", "fan_size": "120", "certificate": "bronze"}','{"regard": {"price": 5610, "url": "https://www.regard.ru/product/454469/blok-pitaniia-450w-be-quiet-system-power-10"}}','https://www.regard.ru/api/site/cacheimg/goods/1002350/1600','{"\u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c": "be quiet", "\u043a\u043e\u0434 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "bn326", "\u043c\u043e\u0449\u043d\u043e\u0441\u0442\u044c": "450 \u0432\u0442", "\u0441\u0442\u0430\u043d\u0434\u0430\u0440\u0442": "atx12v 2.52", "pfc": "\u0430\u043a\u0442\u0438\u0432\u043d\u044b\u0439", "\u0440\u0430\u0437\u043c\u0435\u0440 \u0432\u0435\u043d\u0442\u0438\u043b\u044f\u0442\u043e\u0440\u0430": "120 \u043c\u043c", "\u0442\u0438\u043f \u0440\u0430\u0437\u044a\u0451\u043c\u0430 \u0434\u043b\u044f \u043c\u0430\u0442\u0435\u0440\u0438\u043d\u0441\u043a\u043e\u0439 \u043f\u043b\u0430\u0442\u044b": "20+4 pin", "\u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0440\u0430\u0437\u044a\u0451\u043c\u043e\u0432 4+4-pin cpu": "1", "\u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0440\u0430\u0437\u044a\u0451\u043c\u043e\u0432 6+2-pin pci-e": "2", "\u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0440\u0430\u0437\u044a\u0451\u043c\u043e\u0432 4-pin ide (molex)": "1", "\u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0440\u0430\u0437\u044a\u0451\u043c\u043e\u0432 15-pin sata": "6", "\u0442\u043e\u043a \u043f\u043e \u043b\u0438\u043d\u0438\u0438 +3.3 \u0432": "20 a", "\u0442\u043e\u043a \u043f\u043e \u043b\u0438\u043d\u0438\u0438 +5 \u0432": "20 a", "\u0442\u043e\u043a \u043f\u043e \u043b\u0438\u043d\u0438\u0438 +12 \u0432 1": "37.5 a", "\u0442\u043e\u043a \u043f\u043e \u043b\u0438\u043d\u0438\u0438 -12 \u0432": "0.3 a", "\u0442\u043e\u043a \u043f\u043e \u043b\u0438\u043d\u0438\u0438 +5 \u0432 standby": "3 a", "\u0437\u0430\u0449\u0438\u0442\u0430 \u043e\u0442 \u043f\u0435\u0440\u0435\u043d\u0430\u043f\u0440\u044f\u0436\u0435\u043d\u0438\u044f": "\u0434\u0430", "\u0437\u0430\u0449\u0438\u0442\u0430 \u043e\u0442 \u043f\u0435\u0440\u0435\u0433\u0440\u0443\u0437\u043a\u0438": "\u0434\u0430", "\u0437\u0430\u0449\u0438\u0442\u0430 \u043e\u0442 \u043a\u043e\u0440\u043e\u0442\u043a\u043e\u0433\u043e \u0437\u0430\u043c\u044b\u043a\u0430\u043d\u0438\u044f": "\u0434\u0430", "\u0441\u0435\u0440\u0442\u0438\u0444\u0438\u043a\u0430\u0442 80 plus": "bronze", "\u043e\u0442\u0441\u0442\u0451\u0433\u0438\u0432\u0430\u044e\u0449\u0438\u0435\u0441\u044f \u043a\u0430\u0431\u0435\u043b\u0438": "\u043d\u0435\u0442", "\u0434\u043b\u0438\u043d\u0430 \u043a\u0430\u0431\u0435\u043b\u044f \u043f\u0438\u0442\u0430\u043d\u0438\u044f \u043c\u0430\u0442\u0435\u0440\u0438\u043d\u0441\u043a\u043e\u0439 \u043f\u043b\u0430\u0442\u044b": "55 \u0441\u043c", "\u043f\u043e\u0434\u0441\u0432\u0435\u0442\u043a\u0430": "\u043d\u0435\u0442", "\u0432\u0435\u0441": "1.74 \u043a\u0433", "\u0433\u0430\u0440\u0430\u043d\u0442\u0438\u044f": "36 \u043c\u0435\u0441. ", "\u0441\u0430\u0439\u0442 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "www.bequiet.com"}');
