INSERT INTO ssd VALUES('mz-v7s1t0bw','{"author": "samsung", "ssd_drive_capacity": "1tb", "purpose": "\u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0438\u0439", "type": "ssd", "form_factor": "m.2", "interface": "pci-e", "nvme_support": true, "reading_speed": "3500", "writing_speed": "3300"}','{"regard": {"price": 7860, "url": "https://www.regard.ru/product/312973/nakopitel-ssd-1tb-samsung-970-evo-plus-mz-v7s1t0bw"}}','https://www.regard.ru/api/site/cacheimg/goods/357416/1600','{"\u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c": "samsung", "\u043a\u043e\u0434 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "mz-v7s1t0bw", "\u0432\u043d\u0438\u043c\u0430\u043d\u0438\u0435": "\u0432 \u0441\u043f\u0435\u0446\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u044f\u0445 samsung \u0443\u043a\u0430\u0437\u0430\u043d\u043e \"3bit mlc\", \u0442.\u0435. 3bit multi-level cells - \u044d\u0442\u043e \u0438 \u0435\u0441\u0442\u044c tlc, triple-level cells \u0441 3 \u0431\u0438\u0442\u0430\u043c\u0438 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u0438 \u043d\u0430 \u044f\u0447\u0435\u0439\u043a\u0443, \u0430 \u0443 mlc \u0432 \u044f\u0447\u0435\u0439\u043a\u0435 \u043f\u0430\u043c\u044f\u0442\u0438 \u0445\u0440\u0430\u043d\u0438\u0442\u0441\u044f 2 \u0431\u0438\u0442\u0430.", "\u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435": "\u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0438\u0439", "\u0442\u0438\u043f": "ssd", "\u0444\u043e\u0440\u043c-\u0444\u0430\u043a\u0442\u043e\u0440": "m.2", "\u0438\u043d\u0442\u0435\u0440\u0444\u0435\u0439\u0441": "pci-e x4", "\u043f\u043e\u0434\u0434\u0435\u0440\u0436\u043a\u0430 nvme": "\u0434\u0430", "\u043e\u0431\u044a\u0451\u043c \u043d\u0430\u043a\u043e\u043f\u0438\u0442\u0435\u043b\u044f": "1000 \u0433\u0431", "\u0442\u0438\u043f \u0444\u043b\u044d\u0448-\u043f\u0430\u043c\u044f\u0442\u0438": "tlc", "\u043a\u043e\u043d\u0442\u0440\u043e\u043b\u043b\u0435\u0440": "samsung phoenix", "\u043e\u0431\u044a\u0451\u043c \u043a\u044d\u0448 \u043f\u0430\u043c\u044f\u0442\u0438": "1024 \u043c\u0431", "\u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c \u0447\u0442\u0435\u043d\u0438\u044f": "3500 \u043c\u0431/\u0441\u0435\u043a", "\u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c \u0437\u0430\u043f\u0438\u0441\u0438": "3300 \u043c\u0431/\u0441\u0435\u043a", "\u0440\u0435\u0441\u0443\u0440\u0441 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0438\u0441\u0438 (tbw)": "600 \u0442\u0431", "\u0432\u0440\u0435\u043c\u044f \u043d\u0430\u0440\u0430\u0431\u043e\u0442\u043a\u0438 \u043d\u0430 \u043e\u0442\u043a\u0430\u0437": "1500000 \u0447", "\u0434\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u0430\u044f \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u044f": "\u043d\u043e\u0432\u0430\u044f 96-\u0441\u043b\u043e\u0439\u043d\u0430\u044f tlc 3d v-nand \u043f\u044f\u0442\u043e\u0433\u043e \u043f\u043e\u043a\u043e\u043b\u0435\u043d\u0438\u044f - \u0437\u0430\u043c\u0435\u043d\u0430 \u0441\u0442\u0430\u0440\u043e\u0439 64-\u0441\u043b\u043e\u0439\u043d\u043e\u0439 \u0432 \u043b\u0438\u043d\u0435\u0439\u043a\u0435 970 evo,\n\u0431\u043b\u0430\u0433\u043e\u0434\u0430\u0440\u044f \u043a\u043e\u043c\u0431\u0438\u043d\u0430\u0446\u0438\u0438 \u043d\u043e\u0432\u0435\u0439\u0448\u0435\u0439 \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0438 v-nand \u0438 \u043e\u043f\u0442\u0438\u043c\u0438\u0437\u0430\u0446\u0438\u0439 \u043c\u0438\u043a\u0440\u043e\u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u044b, 970 evo plus \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0438\u0432\u0430\u0435\u0442 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c \u043f\u0440\u0438 \u0441\u043b\u0443\u0447\u0430\u0439\u043d\u043e\u0439 \u0437\u0430\u043f\u0438\u0441\u0438 \u043d\u0430 57% \u0432\u044b\u0448\u0435, \u0447\u0435\u043c 970 evo", "\u0433\u0430\u0440\u0430\u043d\u0442\u0438\u044f": "12 \u043c\u0435\u0441. ", "\u0441\u0430\u0439\u0442 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f": "www.samsung.com"}');
